import React from 'react';
import { useNavigate } from 'react-router-dom';
import { setDifficulty } from '../api';

const HomePage = () => {
    const navigate = useNavigate();

    const handleDifficultyClick = async (difficulty) => {
        try {
            await setDifficulty(difficulty);
            console.log("the difficulty is ", difficulty);
            navigate('/game');
        } catch (error) {
            alert('Failed to set difficulty.');
        }
    };

    return (
        <div>
            <h1>Welcome to Rishabh's Teeko AI</h1>
            <h2>Select the difficulty level:</h2>
            <button onClick={() => handleDifficultyClick('beginner')}>Beginner</button>
            <button onClick={() => handleDifficultyClick('intermediate')}>Intermediate</button>
            <button onClick={() => handleDifficultyClick('expert')}>Expert</button>
            <p>
                Need a refresher on how to play Teeko? <br />
                <a href="https://en.wikipedia.org/wiki/Teeko" target="_blank" rel="noopener noreferrer">
                    Learn here
                </a>
            </p>
        </div>
    );
};

export default HomePage;
